import React from 'react';
import signinimage from '../../images/minimal_standing_desk.svg';
import './Signup.css';

const Signup =() => {
    return(
        <div>
            <section className={'signup'}>
                <div className={'container mt-5'}>
                    <div className={'signup-content'}>

                    </div>
                </div>
            </section>
        </div>
    )
}

export default Signup;
